#
# TABLE STRUCTURE FOR: likes
#

DROP TABLE IF EXISTS `likes`;

CREATE TABLE `likes` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `like_owner_id` int(10) unsigned NOT NULL COMMENT 'id пользователя создавшего лайк',
  `post_id` int(10) unsigned NOT NULL COMMENT 'какому посту поставлен лайк',
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: posts
#

DROP TABLE IF EXISTS `posts`;

CREATE TABLE `posts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `post_owner_id` int(10) unsigned NOT NULL COMMENT 'id пользователя создавшего пост',
  `post_body` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'наполнение поста',
  `like_count` int(10) unsigned DEFAULT NULL COMMENT 'счетчик лайков',
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=601 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



